package Algorithms.SlidingWindow;

import java.util.*;

public class FindAllAnagramsInAString {
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<>();
        int n = s.length();
        HashMap<Character, Integer> sMap = new HashMap<>();
        HashMap<Character, Integer> pMap = new HashMap<>();

        for(int i = 0; i < p.length(); i++){
            char c = p.charAt(i);
            pMap.put(c, pMap.getOrDefault(c, 0) + 1);
        }

        int have = 0, need = pMap.size(), l = 0;
        for(int r = 0; r < n; r++){
            char c = s.charAt(r);
            sMap.put(c, sMap.getOrDefault(c, 0) + 1);
            if(pMap.containsKey(c) && pMap.get(c).equals(sMap.get(c))){
                //if sMap has equal no of this character only then increase have, if more than pMap, then no need to increase, only if equal
                have++;
            }

            if(r < p.length() - 1){
                //didnt reach full window length yet so continue
                continue;
            }
            //now compare current window with need
            if(have == need){
                res.add(l);
            }
            //now remove character at l
            char out = s.charAt(l);
            if(pMap.containsKey(out) && pMap.get(out).equals(sMap.get(out))){
                //means a required character will be removed from sMap and current count of that character in sMap is less than required
                have--;
            }
            sMap.put(out, sMap.get(out) - 1);
            l++;
        }
        return res;
    }
    public static void main(String[] args) {
        FindAllAnagramsInAString findAllAnagramsInAString = new FindAllAnagramsInAString();
        System.out.println(findAllAnagramsInAString.findAnagrams("", ""));
    }
}